Phool Bane Angaare|1963|Vintage Classic|x264|MP3|Phantom

Based in Santa Cruz, Bombay, Usha undertakes to look after her family consisting of her widowed mother and younger brother, Ashish, and even decides to not marry her army officer sweetheart, Captain Rajesh, so that she can look after them. Rajesh is called to the front in Korea, her mom passes away, and she brings up Ashish on her own. Years later, Rajesh has still not returned, Ashish gets married to Kamla, much to Usha's chagrin. Shortly after the marriage, Kamla humiliates Usha and she decides to leave. The question remains where will a lone woman re-locate, and what prevented Ashish from coming to her assistance.

